import React, { Component } from 'react';

class AddNinja extends Component {

  render() {
    return (
      <div>
<form>
<label htmlFor="name">Name:</label>
<input type="text" id="name" ></input>

</form>
      </div>
    );
  }

}

export default AddNinja;
